            <!-- Drawn Heatmap -->
            <script>
                function drawHeatMap(seen_ip) {
                    const request = new XMLHttpRequest();
                    // Open a new connection, using the POST request on the URL endpoint.
                    request.open('POST', '../login_locs', true);

                    request.onload = function () {  // Process response somehow.
                        response_string = this.response;
                        let json = JSON.parse(response_string);
                        let latlong = [];
                        for (loc of json.test_user) {
                            lat = loc.coords[0].lat;
                            lon = loc.coords[0].long;

                            if ($('#despo').prop('checked')) {
                                for (despo of despo_muni) {
                                    let muni = despo.muni;
                                    let geo  = loc.geo[0].Municipality.replace("ï¿½", "Ã¡");

                                    if (geo == muni ) {
                                        latlong.push([lat, lon, seen_ip.get(loc.ip)*100]);
                                    }
                                }
                            } else {
                                latlong.push([lat, lon, seen_ip.get(loc.ip)*100]);
                            }
                        }

                        var heat = L.heatLayer(latlong, {radius: 25}).addTo(map);
                    }

                    let items = "";
                    for (ip of seen_ip)
                        items += ip[0]+' NA ';

                    // Send request
                    request.setRequestHeader("Content-Type", "application/json;charset=utf-8");
                    request.send(JSON.stringify({
                        //user_id: "<?php echo Auth::user()->id?>",
                        user_id: "test_user",
                        count: seen_ip.size-1,
                        items: items
                    }));
                }
            </script>

            <!-- Search on dropdowns -->
            <script>
                function searchDropdown(item_type) {
                    /*
                    * Source: https://www.w3schools.com/howto/howto_js_filter_dropdown.asp
                    */

                    let input, filter, ul, li, a, i;
                    input = document.getElementById(item_type + '-search-input');
                    filter = input.value.toUpperCase();
                    div = document.getElementById(item_type + '_dropdown');
                    button = div.getElementsByTagName('a');
                    for (i = 0; i < button.length; i++) {
                        txtValue = button[i].textContent || button[i].innerText;
                        if (txtValue.toUpperCase().indexOf(filter) > -1) {
                            button[i].style.display = "";
                        } else {
                            button[i].style.display = "none";
                        }
                    }
                } 
            </script>
